import React from 'react';
import Todos from './components/Todos';

import './App.css';

class App extends React.Component {
  state = {
    todos: [
      {
        id: 1,
        title: 'Take out the trash',
        completed: false
      },
      {
        id: 2,
        title: 'Make dinner',
        completed: false
      },
      {
        id: 3,
        title: 'Business Meeting',
        completed: false
      }
    ] 
  }

  render() {
    console.log(this.state.todos);
    return (
      <div className="App">

        <h1>App</h1>
        <Todos todos={state.todos} />
      </div>
    );
  }
}

export default App;
